"use strict";(self.webpackChunkweslley_io=self.webpackChunkweslley_io||[]).push([[6104],{7855:function(e){e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"/2025/09/18/tdc","metadata":{"permalink":"/en/talks/2025/09/18/tdc","source":"@site/i18n/en/docusaurus-plugin-content-blog-talks/2025/09/18/tdc.mdx","title":"TDC S\xe3o Paulo","description":"Banner","date":"2025-09-18T00:00:00.000Z","tags":[{"inline":false,"label":"Brazil","permalink":"/en/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"SP","permalink":"/en/talks/tags/sp","description":"SP tag description"},{"inline":false,"label":"S\xe3o Paulo","permalink":"/en/talks/tags/sao-paulo","description":"S\xe3o Paulo tag description"}],"readingTime":0.72,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, MySQL2\'s co-maintainer and Poku\'s creator \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/en/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"TDC S\xe3o Paulo","authors":["wellwelwel"],"tags":["br","sp","sao-paulo"]},"unlisted":false,"lastUpdatedAt":1764728222000,"nextItem":{"title":"Roga DX","permalink":"/en/talks/2025/09/13/roga"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.jpeg)\\n</Parallax>\\n\\n\ud83c\udf99\ufe0f **Talk:** Uncovering Tests: Creating Secure and Resilient Systems<br />\\n\ud83e\udd1d **Feat:** [Larissa Azevedo](https://www.linkedin.com/in/larissasazevedo/)\\n\\n:::note Summary\\n\\n- Test the functionality of our application? \u2705\\n- Break our application before the user or an attacker? That\'s different.\\n\\n:::\\n\\n{/* truncate */}\\n\\nLet\'s demystify test coverage and understand how to create tests that make our application predictable against the unpredictable.\\n\\nMore than just testing, you will learn to create secure validations and understand in practice the impact of data transformation.\\n\\nAnd if you think security is just about code, even the LGPD will come through here from the perspective of someone who managed to access our database.\\n\\nThe idea is for you to realize that tests are not an additional task: they are part of our application and are essential for digital and human security."},{"id":"/2025/09/13/roga","metadata":{"permalink":"/en/talks/2025/09/13/roga","source":"@site/i18n/en/docusaurus-plugin-content-blog-talks/2025/09/13/roga.mdx","title":"Roga DX","description":"Banner","date":"2025-09-13T00:00:00.000Z","tags":[{"inline":false,"label":"Brazil","permalink":"/en/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"AL","permalink":"/en/talks/tags/al","description":"AL tag description"},{"inline":false,"label":"Macei\xf3","permalink":"/en/talks/tags/maceio","description":"Macei\xf3 tag description"}],"readingTime":0.85,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, MySQL2\'s co-maintainer and Poku\'s creator \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/en/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"Roga DX","authors":["wellwelwel"],"tags":["br","al","maceio"]},"unlisted":false,"lastUpdatedAt":1764728222000,"prevItem":{"title":"TDC S\xe3o Paulo","permalink":"/en/talks/2025/09/18/tdc"},"nextItem":{"title":"MVP Conf: Tech Talk","permalink":"/en/talks/2025/08/27/mvpconf-techtalk"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.jpeg)\\n</Parallax>\\n\\n\ud83c\udf99\ufe0f **Talk:** Uncovering Tests: Creating Secure and Resilient Systems\\n\\n:::note Summary\\n\\n- Test the functionality of our application? \u2705\\n- Break our application before the user or an attacker? That\'s different.\\n\\n:::\\n\\n:::tip Bonus\\n\\nIn addition to the lecture, I had the immense pleasure of recording an episode of the podcast from [**Curso em V\xeddeo**](https://www.youtube.com/cursoemvideo) with, simply, [**Gustavo Guanabara**](https://www.instagram.com/gustavoguanabara/) \ud83d\udd96\\n\\n:::\\n\\n{/* truncate */}\\n\\nLet\'s demystify test coverage and understand how to create tests that make our application predictable against the unpredictable.\\n\\nMore than just testing, you will learn to create secure validations and understand in practice the impact of data transformation.\\n\\nAnd if you think security is just about code, even the LGPD will come through here from the perspective of someone who managed to access our database.\\n\\nThe idea is for you to realize that tests are not an additional task: they are part of our application and are essential for digital and human security."},{"id":"/2025/08/27/mvpconf-techtalk","metadata":{"permalink":"/en/talks/2025/08/27/mvpconf-techtalk","source":"@site/i18n/en/docusaurus-plugin-content-blog-talks/2025/08/27/mvpconf-techtalk.mdx","title":"MVP Conf: Tech Talk","description":"Banner","date":"2025-08-27T00:00:00.000Z","tags":[{"inline":false,"label":"Brazil","permalink":"/en/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"Online","permalink":"/en/talks/tags/online","description":"Online tag description"}],"readingTime":1.01,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, MySQL2\'s co-maintainer and Poku\'s creator \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/en/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"MVP Conf: Tech Talk","authors":["wellwelwel"],"tags":["br","online"]},"unlisted":false,"lastUpdatedAt":1764728222000,"prevItem":{"title":"Roga DX","permalink":"/en/talks/2025/09/13/roga"},"nextItem":{"title":"Semana de Sistemas de Informa\xe7\xe3o (EACH-USP)","permalink":"/en/talks/2025/08/21/each-usp"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.png)\\n</Parallax>\\n\\n\ud83d\udcf9 **Palestra (Live):** GitHub Beyond Code: overcoming in the job market through open source\\n\\n:::note Summary\\nAimed at new developers, I spoke about the impact that open source and **GitHub** can have on our careers, on the **TechTalk** program from the [**MVP Conf**](https://www.youtube.com/@mvpconf) channel, hosted by [**Vanessa Valle**](https://www.linkedin.com/in/vanessabrava/) and [**Renata Correa**](https://www.linkedin.com/in/correa-renata-ti/).\\n:::\\n\\n{/* truncate */}\\n\\nFocusing on how to stand out in an increasingly competitive market, I show how open source can accelerate your technical growth, enabling you to achieve unimaginable milestones that directly impact your professional career.\\n\\nIn a market that is more competitive every day, open source is not just about code \u2014 it\'s a direct bridge to technical growth, global visibility, and real career opportunities.\\n\\nWith visual, human, and real examples, I want to inspire you and bring an optimistic perspective of yourself in an increasingly intimidating world, especially with the rise of artificial intelligence, using open source strategically to build credibility and trust in the market.\\n\\n:::tip\\n[You can watch the live replay on the official **MVP Conf** **YouTube** channel \u2728](https://www.youtube.com/watch?v=alfJ6aEJhhA)\\n:::"},{"id":"/2025/08/21/each-usp","metadata":{"permalink":"/en/talks/2025/08/21/each-usp","source":"@site/i18n/en/docusaurus-plugin-content-blog-talks/2025/08/21/each-usp.mdx","title":"Semana de Sistemas de Informa\xe7\xe3o (EACH-USP)","description":"Banner","date":"2025-08-21T00:00:00.000Z","tags":[{"inline":false,"label":"Brazil","permalink":"/en/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"SP","permalink":"/en/talks/tags/sp","description":"SP tag description"},{"inline":false,"label":"S\xe3o Paulo","permalink":"/en/talks/tags/sao-paulo","description":"S\xe3o Paulo tag description"}],"readingTime":1,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, MySQL2\'s co-maintainer and Poku\'s creator \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/en/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"Semana de Sistemas de Informa\xe7\xe3o (EACH-USP)","authors":["wellwelwel"],"tags":["br","sp","sao-paulo"]},"unlisted":false,"lastUpdatedAt":1764728222000,"prevItem":{"title":"MVP Conf: Tech Talk","permalink":"/en/talks/2025/08/27/mvpconf-techtalk"},"nextItem":{"title":"DevConverge LATAM & Oracle \u2014 SPRINT SP","permalink":"/en/talks/2025/08/09/oracle"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\nimport { SafeLink } from \'@site/src/components/SafeLink\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.jpeg)\\n</Parallax>\\n\\n\ud83c\udf99\ufe0f **Keynote:** GitHub Beyond Code: overcoming in the job market through open source\\n\\n:::note\\nSpeaking at a university (<SafeLink to=\\"https://www5.each.usp.br/\\">**USP**</SafeLink>) is special in itself, but closing the day\'s event made it even more special \u2728\\n\\nThe <SafeLink to=\\"https://www.semanadesi.com/\\">**SSI**</SafeLink> is an event organized by the university students themselves, and I had the pleasure of being invited to teach through open source, using **GitHub** as a learning tool.\\n:::\\n\\n{/* truncate */}\\n\\nFocusing on how to stand out in an increasingly competitive market, I show how open source can accelerate your technical growth, enabling you to achieve unimaginable milestones that directly impact your professional career.\\n\\nIn a market that is more competitive every day, open source is not just about code \u2014 it\'s a direct bridge to technical growth, global visibility, and real career opportunities.\\n\\nWith visual, human, and real examples, I want to inspire you and bring an optimistic perspective of yourself in an increasingly intimidating world, especially with the rise of artificial intelligence, using open source strategically to build credibility and trust in the market."},{"id":"/2025/08/09/oracle","metadata":{"permalink":"/en/talks/2025/08/09/oracle","source":"@site/i18n/en/docusaurus-plugin-content-blog-talks/2025/08/09/oracle.mdx","title":"DevConverge LATAM & Oracle \u2014 SPRINT SP","description":"Banner","date":"2025-08-09T00:00:00.000Z","tags":[{"inline":false,"label":"Brazil","permalink":"/en/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"SP","permalink":"/en/talks/tags/sp","description":"SP tag description"},{"inline":false,"label":"S\xe3o Paulo","permalink":"/en/talks/tags/sao-paulo","description":"S\xe3o Paulo tag description"}],"readingTime":0.64,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, MySQL2\'s co-maintainer and Poku\'s creator \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/en/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"DevConverge LATAM & Oracle \u2014 SPRINT SP","authors":["wellwelwel"],"tags":["br","sp","sao-paulo"]},"unlisted":false,"lastUpdatedAt":1764728222000,"prevItem":{"title":"Semana de Sistemas de Informa\xe7\xe3o (EACH-USP)","permalink":"/en/talks/2025/08/21/each-usp"},"nextItem":{"title":"Codecon Summit \u2014 Embrace the Hacker Way","permalink":"/en/talks/2025/07/19/codecon-summit"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.jpeg)\\n</Parallax>\\n\\n\ud83c\udf99\ufe0f **Talk:** Inventing the New: The Meeting Point Between Human Creativity and AI-Assisted Generation\\n\\n:::note Summary\\nImproving performance in a legacy system is part of the routine. Inventing algorithms and a brand-new architecture is something completely different.\\n:::\\n\\n{/* truncate */}\\n\\nIn this talk, I share the behind-the-scenes of rebuilding a critical open source ecosystem library, **MySQL2**, to efficiently process billions of **MySQL** requests.\\n\\nWe\'ll go through the problems, ideas, implementations, how to teach **LLMs** to handle something new, and even the remediation of 4 large-scale critical vulnerabilities (**CVEs**).\\n\\nAdditionally, you\'ll learn about the process of making the largest **MySQL** client for **JavaScript** compatible with **TypeScript**, **Bun**, **Deno**, and **Cloudflare Workers**."},{"id":"/2025/07/19/codecon-summit","metadata":{"permalink":"/en/talks/2025/07/19/codecon-summit","source":"@site/i18n/en/docusaurus-plugin-content-blog-talks/2025/07/19/codecon-summit.mdx","title":"Codecon Summit \u2014 Embrace the Hacker Way","description":"Banner","date":"2025-07-19T00:00:00.000Z","tags":[{"inline":false,"label":"Brazil","permalink":"/en/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"PR","permalink":"/en/talks/tags/pr","description":"PR tag description"},{"inline":false,"label":"Curitiba","permalink":"/en/talks/tags/curitiba","description":"Curitiba tag description"}],"readingTime":0.82,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, MySQL2\'s co-maintainer and Poku\'s creator \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/en/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"Codecon Summit \u2014 Embrace the Hacker Way","authors":["wellwelwel"],"tags":["br","pr","curitiba"]},"unlisted":false,"lastUpdatedAt":1764728222000,"prevItem":{"title":"DevConverge LATAM & Oracle \u2014 SPRINT SP","permalink":"/en/talks/2025/08/09/oracle"},"nextItem":{"title":"Winx Day (Luciano dii Souza \u2014 O Primo Dev)","permalink":"/en/talks/2025/06/14/winx-day"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.jpeg)\\n</Parallax>\\n\\n\ud83c\udf99\ufe0f **Talk:** Creating a Test Runner: What happens behind the tests?\\n\\n:::note Summary\\nThere\'s a lot of talk about testing, but what\'s it like to create a test runner from scratch?<br />\\nMore than that: how do you test a test runner?\\n:::\\n\\n{/* truncate */}\\n\\nIn this talk, I break down Poku, the only Brazilian _test runner_ for **JavaScript** and **TypeScript**, which challenges more than 14 years of language history by bringing native **JavaScript** syntax to tests.\\n\\nYou\'ll learn about the power of subprocesses, isolation, and the advantages of working with concurrency\u2014all using only native language features.\\n\\nWait, native syntax?\\n\\nYou\'ll discover the history of testing in **JavaScript** and why tests don\'t follow the natural flow of the language, while uncovering the inner workings of the most popular _test runners_.\\n\\nThis is the kind of insight that, regardless of which _tester_ you use, will change the way you truly see testing."},{"id":"/2025/06/14/winx-day","metadata":{"permalink":"/en/talks/2025/06/14/winx-day","source":"@site/i18n/en/docusaurus-plugin-content-blog-talks/2025/06/14/winx-day.mdx","title":"Winx Day (Luciano dii Souza \u2014 O Primo Dev)","description":"Banner","date":"2025-06-14T00:00:00.000Z","tags":[{"inline":false,"label":"Brazil","permalink":"/en/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"Online","permalink":"/en/talks/tags/online","description":"Online tag description"}],"readingTime":1.06,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, MySQL2\'s co-maintainer and Poku\'s creator \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/en/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"Winx Day (Luciano dii Souza \u2014 O Primo Dev)","authors":["wellwelwel"],"tags":["br","online"]},"unlisted":false,"lastUpdatedAt":1764728222000,"prevItem":{"title":"Codecon Summit \u2014 Embrace the Hacker Way","permalink":"/en/talks/2025/07/19/codecon-summit"},"nextItem":{"title":"GitHub Brasil \u2014 Open Source Friday","permalink":"/en/talks/2025/03/14/github-brasil"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.png)\\n</Parallax>\\n\\n\ud83d\udcf9 **Live (Talk):** Overcoming impostor syndrome and the challenges of existing in the market through open source.\\n\\n:::info\\nAn online event organized by [**Luciano dii Souza**](https://www.linkedin.com/in/lucianodiisouza/), with a relaxed approach and held through the [**Discord**](https://discord.gg/wyrRdpGKmj) community for developers, aiming to share experiences and knowledge, especially for those who are just starting in the field.\\n:::\\n\\n{/* truncate */}\\n\\nAt this moment when many developers feel insecure about the future of the field:\\n\\n- Is my level sufficient?\\n- Should I give up if I can\'t get a job in my field?\\n- How do I gain experience if the market doesn\'t give me opportunities?\\n- After all, will Artificial Intelligence replace developers or not?\\n\\nBringing up sensitive topics like insecurity, inferiority complex, and self-sabotage, with a light at the end of the tunnel through open source initiatives, was quite challenging but very interesting.\\n\\nThis is a talk where I expose the insecurities during my journey, speaking in a tone close to what would be a heartfelt confession.\\n\\nThe intention is to connect with those participating, evolve toward learning, and perhaps inspire through my story, sharing the human side that social networks and \\"LinkedIn titles\\" don\'t show."},{"id":"/2025/03/14/github-brasil","metadata":{"permalink":"/en/talks/2025/03/14/github-brasil","source":"@site/i18n/en/docusaurus-plugin-content-blog-talks/2025/03/14/github-brasil.mdx","title":"GitHub Brasil \u2014 Open Source Friday","description":"Banner","date":"2025-03-14T00:00:00.000Z","tags":[{"inline":false,"label":"Brazil","permalink":"/en/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"Online","permalink":"/en/talks/tags/online","description":"Online tag description"}],"readingTime":1.01,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, MySQL2\'s co-maintainer and Poku\'s creator \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/en/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"GitHub Brasil \u2014 Open Source Friday","authors":["wellwelwel"],"tags":["br","online"]},"unlisted":false,"lastUpdatedAt":1764728222000,"prevItem":{"title":"Winx Day (Luciano dii Souza \u2014 O Primo Dev)","permalink":"/en/talks/2025/06/14/winx-day"},"nextItem":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","permalink":"/en/talks/2024/11/23/devfest-cerrado-google-developer-groups"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.png)\\n</Parallax>\\n\\n\ud83d\udcf9 **Talk (Live):** Meeting [**Poku**](https://github.com/wellwelwel/poku).\\n\\n:::note\\nIn a conversation that was both technical and casual, I had the honor of kicking off the very first edition of **Open Source Friday** by [**GitHub Brasil**](https://www.linkedin.com/company/github-brazil), hosted by [**Pachi Parra**](https://www.linkedin.com/in/pachicodes/).\\n:::\\n\\n{/* truncate */}\\n\\nDuring the live session, I was able to share a bit about myself, the importance of open source, motivations, challenges, and future plans for [Poku](https://github.com/wellwelwel/poku), as well as give some great tips for those who want to contribute for the first time, especially for those who feel insecure.\\n\\nIn one hour of live streaming, there were conversations, low vs. too-high microphone volume, explanations about module systems, and the differences in behavior between **Node.js**, **Bun**, and **Deno**.\\n\\nThere was even live coding, demonstrating in practice why other test runners are not fully compatible with all JavaScript backends and how **Poku** challenges more than 12 years of language history by bringing JavaScript\'s natural flow to testing.\\n\\n:::tip\\n\\n[You can replay the live session on the official **GitHub Brasil** **LinkedIn** \ud83d\udc37](https://www.linkedin.com/events/7305618122546294807/comments/)\\n\\n:::"},{"id":"/2024/11/23/devfest-cerrado-google-developer-groups","metadata":{"permalink":"/en/talks/2024/11/23/devfest-cerrado-google-developer-groups","source":"@site/i18n/en/docusaurus-plugin-content-blog-talks/2024/11/23/devfest-cerrado-google-developer-groups.mdx","title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","description":"Banner","date":"2024-11-23T00:00:00.000Z","tags":[{"inline":false,"label":"Brazil","permalink":"/en/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"GO","permalink":"/en/talks/tags/go","description":"GO tag description"},{"inline":false,"label":"Goi\xe2nia","permalink":"/en/talks/tags/goiania","description":"Goi\xe2nia tag description"}],"readingTime":1.59,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, MySQL2\'s co-maintainer and Poku\'s creator \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/en/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","authors":["wellwelwel"],"tags":["br","go","goiania"]},"unlisted":false,"lastUpdatedAt":1764728222000,"prevItem":{"title":"GitHub Brasil \u2014 Open Source Friday","permalink":"/en/talks/2025/03/14/github-brasil"},"nextItem":{"title":"Microsoft Reactor and NodeBR","permalink":"/en/talks/2024/08/30/microsoft-reactor-e-nodebr"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.png)\\n</Parallax>\\n\\n\ud83c\udf99\ufe0f **Talk:** Overcoming the impostor syndrome and the challenges of existing in the industry through open-source.\\n\\n:::note Summary\\nAt a time when many developers feel insecure about the future of the field, bringing up sensitive topics like insecurity, inferiority complex, and self-sabotage, with a light at the end of the tunnel through open source initiatives, was quite challenging but very interesting:\\n:::\\n\\n{/* truncate */}\\n\\n## \ud83d\udca1 Choosing the topic\\n\\n- Is my skill level enough?\\n- Should I give up if I can\'t get a job in my area?\\n- How can I gain experience if the market doesn\'t give me opportunities?\\n\\n## \ud83e\uddd1\ud83c\udffb\u200d\ud83d\udd2c The development\\n\\nI could have easily explained what impostor syndrome is and gone straight to the \u201csolution,\u201d but I chose the harder path:\\n\\n\u2014 Exposing my weaknesses throughout my journey, speaking in a tone close to a heartfelt confession.\\n\\nThe goal was to connect with those present, evolve into learning, and maybe inspire through my story, sharing the human side that social media and \\"LinkedIn titles\\" don\'t show.\\n\\n## \ud83d\udc7b The challenges\\n\\nTalking about our flaws and insecurities to people who don\'t even know us is more complicated than it seems; people like to listen to someone they can admire.\\n\\nBut the comments and affection from people who came to talk to me at the end showed me that the idea of connecting with those present not only worked but truly inspired some people, and that made me very happy \u2728\\n\\n## \ud83c\udfa4 The talk\\n\\nI wondered if people would be interested in this topic, but gradually the room filled up and someone even sat on the floor at the very beginning.\\n\\nOriginally, the presentation included some additional studies, including practical screens with real open source contributions, but I had to adapt some things to fit the event\'s format and time.\\n\\n:::tip\\n\\nSpoiler (GIF) of the slide used in the talk:\\n\\n![Banner](./slide.gif)\\n\\n:::"},{"id":"/2024/08/30/microsoft-reactor-e-nodebr","metadata":{"permalink":"/en/talks/2024/08/30/microsoft-reactor-e-nodebr","source":"@site/i18n/en/docusaurus-plugin-content-blog-talks/2024/08/30/microsoft-reactor-e-nodebr.mdx","title":"Microsoft Reactor and NodeBR","description":"Banner","date":"2024-08-30T00:00:00.000Z","tags":[{"inline":false,"label":"Brazil","permalink":"/en/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"SP","permalink":"/en/talks/tags/sp","description":"SP tag description"},{"inline":false,"label":"S\xe3o Paulo","permalink":"/en/talks/tags/sao-paulo","description":"S\xe3o Paulo tag description"},{"inline":false,"label":"Online","permalink":"/en/talks/tags/online","description":"Online tag description"}],"readingTime":0.51,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, MySQL2\'s co-maintainer and Poku\'s creator \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/en/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"Microsoft Reactor and NodeBR","authors":["wellwelwel"],"tags":["br","sp","sao-paulo","online"]},"unlisted":false,"lastUpdatedAt":1764728222000,"prevItem":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","permalink":"/en/talks/2024/11/23/devfest-cerrado-google-developer-groups"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.jpeg)\\n</Parallax>\\n\\n\ud83c\udf99\ufe0f **Talk:** Creating a High-Performance Multi-Platform Test Runner.\\n\\n:::note\\nThe focus of the talk was on the importance of delegating each problem\'s responsibilities using native **Node.js** features.\\n:::\\n\\n{/* truncate */}\\n\\nWith the theme \\"API Like a Boss\\", I had the opportunity to teach using [**Poku**](https://github.com/wellwelwel/poku).\\n\\nInstead of just talking about Poku itself, I also used Poku as an analogy, teaching about subprocesses and the differences between **Node.js**, **Bun**, and **Deno**.\\n\\n:::tip\\n\\n[See the slides used in the talk \ud83d\udc37](https://drive.google.com/file/d/16XxIt_pov5aBidGjIwC4V_riYq3PMlrB/view)\\n\\n:::"}]}}')}}]);